import React, { useState } from 'react';
import { Link } from 'react-router-dom';


const Registration = () => {

    const [data, setData] = useState({
        Email: '',
        password: '',
      });


    const formsubmit = (e) =>
    {
        e.preventDefult();
    }

    const handleChange = (e) =>
    {

        const { name, value } = e.currentTarget;
        setData((prevData) => ({
          ...prevData,
          [name]: value,
        }));
    };

    return ( 
        <>
        <div className='container'>
            <div className="card shadow-card">
                <div className="card-body">
                    <div className='row text-center'>
                        <div className='col-md-6'>
                            <img src="https://sotooracademy.com/images/main-logo.png" className="img_width m-3" />
                            <h2>صفحة انشاء حساب جديد</h2>
                            <h2>عشان تبدع في اختبار القدرات <br />لازم تتأسس صح!</h2>
                            <h4>سجل بياناتك واحصل على دورة مجانية للقدرات -<br /> للقسم الكمي</h4>
                        </div>

                        <div className='col-md-6'>
                            <img src="https://sotooracademy.com/images/main-logo.png" className="img_width m-3" />
                        </div>
                    </div>
                </div>
            </div>
        </div>
        </>
     );
}

export default Registration;
